('comment', 'comment_node_blog', '0', '16', '16', 'und', '0', '<p>Quisque nibh erat, sollicitudin nec suscipit non, lacinia sed lectus. Proin et tortor turpis, non tristique lorem. Aliquam luctus ligula fringilla velit mollis molestie. Aenean ut tincidunt felis. Aenean eu erat sed mauris euismod pretium vitae eu nisi. Cras ultrices justo nec lectus pellentesque ultricies. Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>', 'filtered_html'),
('comment', 'comment_node_blog', '0', '17', '17', 'und', '0', '<p>In vitae nibh metus. Nullam egestas consequat purus, sit amet lacinia augue accumsan eu. Praesent a ante neque, ac accumsan velit. Praesent eget ligula eros. Nullam ornare auctor eros, et blandit felis fringilla sit amet. Phasellus eleifend tortor at purus consequat vel tincidunt ante hendrerit. Maecenas at ante libero. Proin tempus vulputate eleifend.</p>', 'filtered_html');
